import React, { useEffect } from "react";

const Homepage = () => {
  useEffect(() => {
    fetch("http://localhost:5050/userData", {
      method: "POST",
      crossDomain: true,
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
        "Access-Control-Allow-Origin": "*",
      },
      body: JSON.stringify({
        email,
        password,
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userRegister");
      });
  }, []);

  return (
    <div>
      <div className="bg-zinc-400 h-screen flex justify-center items-center">
        <div className="bg-white rounded-lg shadow-black/30 h-96 pl-10 space-y-3 w-[350px] flex flex-col justify-center">
          <h1>Name : naveed</h1>
          <h1>Email: naveed@gmail.comm</h1>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
